    const $mfp_src = $settings['mfp_src'] ? $settings['mfp_src'] : false;
    const $mfp_type = $settings['mfp_type'] ? $settings['mfp_type'] : false;
    const $mfp_button_position = ($mfp_type === 'image') ? true : false;

